  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins by giving a brief introduction to the Refuge, as well as
  the climatic and habitat conditions and land acquisition program during the year.
  The construction and maintenance section discusses construction, maintenance, and
  wildfires. Habitat management is discussed; topics include wetlands, croplands,
  grasslands, grazing, haying, fire management, pest control, and water rights. Wildlife-
  including endangered and threatened species, migratory birds and mammals- is also
  covered. The interpretation and recreation section discusses information and interpretation,
  recreation, and enforcement. Items of interest and photographs are attached.\",\n\t\"owner_org\":
